} fn keyboard_added(_compositor_handle: compositor::Handle, _keyboard_handle: keyboard::Handle) -> Option<Box<keyboard::Handler>> { None
} With the provided implementation whenever a keyboard is announced wlroots-rs will call keyboard_added . Since it unconditionally returns None it will not allocate anything for they keyboard resource and it will simple be dropped. In order to hang on to the resource a handler must be defined and allocated using Box to make a trait object. The handler defines how to deal with event the resource can trigger, including when a key is pressed . A trait needs a structure to implement on so a zero-sized is used here so there's no overhead: 2 fn keyboard_added(_compositor_handle: compositor::Handle, _keyboard_handle: keyboard::Handle) -> Option<Box<keyboard::Handler>> { Some(Box::new(KeyboardHandler))
} struct KeyboardHandler; impl keyboard::Handler for KeyboardHandler { // All handler methods have a default implementation that does nothing // So because no methods are define here, every event on the keyboard // is ignored.
