When a key is pressed this method receives the event . The key event has a couple methods but the most important one is pressed_keys . It will provide all the keys as seen by xkb that were pressed when the event fired. Using the keysyms module from the reexported xkbcommon crate the list of keys can be iterated over and pattern matched. The last piece of the puzzle is stopping the compositor. Call terminate to stop the compositor. It can be called at any time and will gracefully kill clients, destroy resource managers, and then wind back up the stack to where run was called. Here is the complete code for a compositor that will be able to close itself if there is a keyboard with an escape key: extern crate wlroots; use wlroots::{compositor, input::{self, keyboard}, utils::log::{WLR_DEBUG, init_logging}, xkbcommon::xkb::keysyms}; fn main() { init_logging(WLR_DEBUG, None); let input_builder = input::manager::Builder::default() .keyboard_added(keyboard_added); compositor::Builder::new() .input_manager(input_builder) .build_auto(()) .run()
} fn keyboard_added(_compositor_handle: compositor::Handle, _keyboard_handle: keyboard::Handle) -> Option<Box<keyboard::Handler>> { Some(Box::new(KeyboardHandler))
} struct KeyboardHandler; impl keyboard::Handler for KeyboardHandler { fn on_key(&mut self, compositor_handle: compositor::Handle, _keyboard_handle: keyboard::Handle, key_event: &keyboard::event::Key) { for key in key_event.pressed_keys() { match key { keysyms::KEY_Escape => wlroots::compositor::terminate(), _ => { /* Do nothing */ } } } }
}

