Handles represent the wlroots-rs solution to the complicated lifetimes of wlroots resources. In Rust normally you can either own a value or borrow it for some lifetime. However, you can't "own" a keyboard because you don't control its lifetime. At any point, for example, the keyboard could be yanked out by the user and then it will need to be cleaned up. You also can't have these be defined via lifetimes on borrows because lifetimes behave like a compile-time read-write lock on data. That does mean there can have a callback that takes a borrow, for example: /// Callback for when a key is pressed
fn on_key(keyboard: &Keyboard) { // A Keyboard will be valid here because wlroots is single threaded.
} but now that resource can't escape these limited callbacks. That's unfortunate because you want to use the resources outside these limited scopes. To solve this a Handle is used to refer indirectly to resources. Handles are essentially thin wrappers around Weak smart pointers . They can only be accessed in callbacks by calling run on them, which performs additional safety checks to ensure the Handle is valid. Please read the handle documentation in order to better understand Handles . A Session is obtained from a Backend . A Backend can be obtained from a &Compositor . To get a reference to the Compositor the compositor_handle must be upgraded. When you upgrade a handle there's a change it can fail according to its signature . The possible error values indicate the two requirements for upgrading a handle: Two handles to the same resource can not be upgraded at the same time. If this were allowed there could be two mutable references to the same resource, which is against Rust's memory model. If the resource behind the handle has been destroyed then the handle can never be upgraded again.3 Because these errors should not occur for the compositor handle, it is sufficient to simply unwrap the result here: impl keyboard::Handler for KeyboardHandler { fn on_key(&mut self, compositor_handle: compositor::Handle, _keyboard_handle: keyboard::Handle, key_event: &keyboard::event::Key) { for key in key_event.pressed_keys() { match key { keysyms::KEY_Escape => wlroots::compositor::terminate(), keysyms::KEY_XF86Switch_VT_1 ..= keysyms::KEY_XF86Switch_VT_12 => { compositor_handle.run(|compositor| { let backend = compositor.backend_mut(); if let Some(mut session) = backend.get_session() { session.change_vt(key - keysyms::KEY_XF86Switch_VT_1 + 1); } }).unwrap(); } _ => { /* Do nothing */ } } } }
} 1 Huge caveat to this: if the system is deadlocked, such as by an innocuous loop {} , then the compositor can no longer process input including the escape sequence. Either test all of your features in a nested instance (where input can still be processed by the parent system) or have ssh as a backup to pkill the process. 2 There's still an allocation, but it will allocate sizeof(data_struct) + sizeof(vtable) + sizeof(internal_wayland_listeners) . Even though the size of the data struct is zero there is a non zero cost for the internal wayland listeners and vtable (which allows you to have implementations for the same trait implemented differently on different structs). This is a price you must always pay. In the future it might be possible to specify static listeners . 3 In this case the Compositor lives for the life of the compositor, so it will never be AlreadyDropped . This is not the case for other resources, such as Keyboard s.
